import React from "react";

import { motion } from "framer-motion";

import "./Header.scss";

const Header = () => {
  return (
    <div className="app__header">
      <h1>Web Developer</h1>
      <p>
        Passionate web developer with 3 years of working with web technologies.
        I have also studied Cyber Security learning the fundamentals of
        Networking, Network and Web Application Defence, Security Threats and
        Security Attacks. I really enjoy solving problems in the most efficient
        way and exploring new technologies.
      </p>
    </div>
  );
};

export default Header;
